import React from 'react';
import './App.css';
import { Routes}  from './Routes'
import { BrowserRouter as Router } from 'react-router-dom'
import Nav from './Components/Nav'


class App  extends React.Component{
 render (){
  return (
    <Router>
        <Nav/>
        <Routes/>
     </Router>
    )
   }
}

export default App;
